	      interRowLineBreaks: interRowLineBreaks,
	      leadingLineBreaks: leadingLineBreaks,
	      maxLineLength: this._stackItem.inlineTextBuilder.maxLineLength,
	      maxPrefixLength: maxPrefixLength,
	      prefixAlign: prefixAlign
